import MyHeader from "./MyHeader";
import MyHead from "./MyHead";

const Layout = props => {
  return (
    <>
      <MyHead page={props.page} />
      <div>
        <MyHeader />
        {props.children}
      </div>
      <style jsx global>{`
        html,
        body {
          background: #e9edef;
          position: relative;
          font-family: "Dosis", sans-serif;
          letter-spacing: 1px;
          margin: 20px;
          padding: 0;
          overflow-x: hidden;
          color: #252b33;
        }
        p::selection,
        h1::selection,
        h2::selection,
        h3::selection,
        li::selection {
          color: #f3f5f6;
          background-color: rgb(120, 169, 152);
        }
        a {
          text-decoration: none;
          color: #252b33;
        }
        a:hover,
        a:active,
        a:focus,
        a: visited {
          color: gray;
        }
      `}</style>
    </>
  );
};

export default Layout;
